import UIKit

func lengthOfLongestSubstring(_ s: String) -> Int {
    guard s.count > 0 else {
        return 0
    }

    var longestRange = 1
    var startIndex: String.Index = s.startIndex
    var endIndex: String.Index = startIndex
    
    while endIndex < s.endIndex {
        let nextIndex = s.index(after: endIndex)
        let range = s[startIndex ... endIndex]
        
        guard nextIndex != s.endIndex else {
            longestRange = max(longestRange, range.count)
            endIndex = nextIndex
            continue
        }
        
        guard range.contains(s[nextIndex]) else {
            endIndex = nextIndex
            continue
        }
        
        longestRange = max(longestRange, range.count)
        
        guard let duplicateIndex = range.firstIndex(of: s[nextIndex]) else {
            startIndex = nextIndex
            endIndex = startIndex
            continue
        }
        
        startIndex = duplicateIndex < s.endIndex ? s.index(after: duplicateIndex) : s.endIndex
        endIndex = startIndex
    }
    
    return longestRange
}

